function getListItems(webUrl, listTitle, queryText) {
    var viewXml = '<View><Query>' + queryText + '</Query></View>';
    var url = webUrl + "/_api/web/lists/getbytitle('" + listTitle + "')/items"+queryText;
    console.log(url);
    var queryPayload = {
        'query': {
            '__metadata': {
                'type': 'SP.CamlQuery'
            },
            'ViewXml': viewXml
        }
    };
    return executeJson(url, "POST", null, queryPayload);
}

